Future Weapons Season 2

Technology Documentary hosted by Richard Machowicz, published by Discovery Channel in 2010 - English narration


Information
------------------------------

Future Weapons Season 2
In the Future Weapons Season 2, join ex-Navy SEAL Richard &quot;Mack&quot; Machowicz on a wild ride around the globe in search of the ultimate weapon. Exploring the amazing science and technology that goes into making the most sinister weapons yet devised, meet the bizarre characters who invent these new ways of obliteration and watch Mack get &quot;hands on&quot; with the most deadly weapons, firing anything from smart missiles to futuristic lasers. See the new stealth submarines, watch the XM307 grenade launcher in action, and get a close-up look at the &quot;spy in the sky&quot;. The Future Weapons DVDs of Season 2 allow you to witness technology once considered top secret!



4)  Top Guns 
Journey with Mack as he flies a combat training mission on board the Navy's Super Hornet. Plus, witness the power of the Barrett M468 assault rifle, the M777 lightweight howitzer and the USS Dwight D. Eisenhower aircraft carrier.



